import React, { Component } from 'react';
import CreateDataset from '../dataset/CreateDataset';
import ShowDataset from '../dataset/ShowDataset';
import DeleteDataset from "../dataset/DeleteDataset";

import Button from '@mui/material/Button';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';
import TableCell from "@mui/material/TableCell";
import TableRow from "@mui/material/TableRow";


class Dataset extends Component {
    constructor(props) {
        super(props);
        this.state = {
            datasetSequence : this.props.datasetSequence,
            datasetOriginalJSON : this.props.datasetOriginalJSON,

            datasetConfigJSON: this.props.datasetOriginalJSON.datasetConfig,
            datasetStatusJSON: this.props.datasetOriginalJSON.status,
        };

        this.handleChange = this.handleChange.bind(this)

    }

    handleChange(e) {
        e.preventDefault()
        this.setState(
            {datasetConfigUserInput : e.currentTarget.value}
        )
    }



    render() {
        const {datasetSequence, datasetOriginalJSON, datasetConfigJSON, datasetStatusJSON} = this.state

        return (
            <TableRow
                key={datasetConfigJSON.name}
                sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
                <TableCell component="th" scope="row">{datasetConfigJSON.name}</TableCell>
                <TableCell align="right">{datasetConfigJSON.status}</TableCell>
                <TableCell align="right">{datasetConfigJSON.status}</TableCell>
                <TableCell align="right">Setting ICON</TableCell>
            </TableRow>


